<g id="node331" class="node"><title>"The Bibliographic Ontology describes bibliographic\nthings on the semantic Web in RDF. This ontology\ncan be used as a citation ontology, as a document\nclassification ontology, or simply as a way to\ndescribe any kind of document in RDF. It has\nbeen inspired by many existing document\ndescription metadata formats, and can be used as a\ncommon ground for converting other bibliographic\ndata sources."</title>

<g id="node719" class="node"><title>"BIBO assert that a dcterms:Agent is an equivalent\nclass to foaf:Agent. This means that all the\nindividuals belonging to the foaf:Agent class also\nbelongs to the dcterms:Agent class. This way,\ndcterms:contributor can be used on foaf:Person,\nfoaf:Organization, foaf:Agent and foaf:Group. Even\nif this link is not done in neither the FOAF nor\nthe DCTERMS ontologies this is a wide spread fact\nthat is asserted by BIBO."</title>
